styles:
  over {
    overflow: hidden;
    margin-bottom: 10px;
  }
  .bg{
    background-size: cover;
    background-position: center center;
  }
  .banner {
    position: relative;
    overflow: hidden;
  }
  .main-cnt{
    width: 100%;
    height: 70px;
    overflow: hidden;
    background-color: #efefef;
  }

  .hgroup {
    padding: 0 20px;
    -webkit-box-pack: center;
    -webkit-justify-content: center;
    -ms-flex-pack: center;
    justify-content: center;
    -webkit-box-orient: vertical;
    -webkit-box-direction: normal;
    -webkit-flex-direction: column;
    -ms-flex-direction: column;
    flex-direction: column;
    display: -webkit-box;
    display: -webkit-flex;
    display: -ms-flexbox;
    display: flex;
    height: 100%;
    text-align: center;
  }
  h2 {
    margin-top: 0;
    margin-bottom: 4px;
    color: white;
    font-size: 4vw;
    font-weight: 600;
}
